import {axios} from 'axios';

const config = "localhost:8080";


export const signin = user => {
  return axios({
    method: 'post',
    url: 'http://localhost:8080/api/auth/signin',
    data: {
      "email": "phattaraphonnn@ubu.ac.th",
      "password": "123456789"
    }
  }).then(res => {
    return res.data;
  }).catch(err => {
    console.log("error", err)
  })
}
